function Nav() {
  return (
    <nav>
      <ul>
        <li><a href="/">Home</a></li>
        <li><a href="/menu">Menu</a></li>
        <li><a href="/reserve">Reserve</a></li>
        <li><a href="/about">About</a></li>
      </ul>
    </nav>
  );
}

export default Nav;
